To launch a decentralized finance (DeFi) project using a token, you will need to set up both the smart contract for your token and a presale mechanism if needed. Here's a step-by-step guide on how to achieve this:

### 1. Smart Contract Setup

First, create your smart contract that represents the new token being issued by your DeFi project.

```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract YourToken {
    string public name;
    uint256 public totalSupply;

    constructor(uint256 _totalSupply) {
        name = "YourToken";
        totalSupply = _totalSupply;
    }

    function transfer(address recipient, uint256 amount) external returns (bool) {
        // Implement token transfer logic here
    }

    // Other functions like balanceOf, approve, etc.
}
```

This is a very basic example. Depending on your needs, you may want to implement additional features such as minting new tokens, transferring ownership of the token, or other utility functions.

### 2. Presale Mechanism

If you want to conduct a private sale before launching the token on a public market (e.g., a Launchpad), you might consider creating an additional contract specifically for the presale. This way, only selected early investors can purchase tokens at a pre-specified price before making them available to the general public.

#### Example: `PresaleToken` Contract

```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PresaleToken {
    mapping(address => bool) private _earlyInvestors; // Store which addresses have been registered in advance

    address payable public owner;

    uint256 public tokenPriceWei;
    uint256 public startTime;
    uint256 public endTime;

    event TokenPurchase(address indexed purchaser, uint256 value);

    constructor(
        uint256 _tokenPriceWei,
        uint256 _startTime,
        uint256 _endTime,
        address _owner
    ) {
        require(_tokenPriceWei > 0, "Price must be greater than zero");
        require(_startTime < block.timestamp + 30 days, "Start time must be future");
        require(_endTime > block.timestamp, "End time must be after start time");

        owner = payable(_owner);
        tokenPriceWei = _tokenPriceWei;
        startTime = _startTime;
        endTime = _endTime;
    }

    function registerEarlyInvestor() public {
        require(!isEarlyInvestor(msg.sender), "Already an early investor.");
        _earlyInvestors[msg.sender] = true;
    }

    function buyTokens() public payable {
        require(isEarlyInvestor(msg.sender), "Only early investors can buy tokens now.");
        require(block.timestamp >= startTime && block.timestamp <= endTime, "Presale period has not ended yet.");

        uint256 tokenAmount = msg.value / tokenPriceWei;

        // Transfer ETH to the contract
        (bool sent,) = msg.sender.call{value: msg.value}("");
        require(sent, "Failed to send Ether");

        // Mint tokens
        uint256 tokensMinted = tokenAmount * 1 ether;
        totalSupply += tokensMinted;

        // Emit the event
        emit TokenPurchase(msg.sender, tokenAmount);
    }

    function getEarlyInvestorsCount() public view returns (uint256) {
        return _earlyInvestors.length();
    }

    modifier onlyEarlyInvestor() {
        require(_earlyInvestors[msg.sender], "Not an early investor.");
        _;
    }

    function isEarlyInvestor(address addr) internal view returns(bool) {
        return _earlyInvestors[addr];
    }
}
```

### 3. Adding Tokens to Launchpad

Once the presale phase ends, your tokens can be added to a launchpad where they will eventually be made available to the public. Here’s how you could integrate the `PresaleToken` into the launchpad:

#### Example: `LaunchpadTokenManager`

Create a contract responsible for managing the launchpad process.

```solidity
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract LaunchpadTokenManager {
    PresaleToken public token;
    address public tokenOwner;
    bool public tokenAvailableForSale = false;
    address[] public contributorsList;

    constructor(PresaleToken _presaleToken, address _owner) {
        token = _presaleToken;
        tokenOwner = _owner;
    }

    function startPublicSale() public {
        require(token.isEarlyInvestor(msg.sender), "Only early investors can activate public sale.");
        require(!tokenAvailableForSale, "Public sale already activated.");
        tokenAvailableForSale = true;
    }

    function addContributors(address[] calldata contributorAddresses) public {
        require(contributorAddresses.length > 0, "No contributors provided.");
        contributorsList.push(...); // Replace with actual contributor list initialization
    }

    function distributeTokens() public {
        require(tokenAvailableForSale, "Public sale hasn't started yet.");
        require(tokensLeft(), "There aren't enough tokens left for distribution.");
        token.transferFrom(owner, msg.sender, numTokens());
    }

    function tokensLeft() public view returns (uint256) {
        return token.balanceOf(address(this)) - token.balanceOf(contributorsList);
    }

    function numTokens() public view returns (uint256) {
        return token.balanceOf(address(this));
    }

    function transferOwnership(address _newOwner) public {
        require(msg.sender == tokenOwner, "Must own token contract to transfer.");
        token.transferOwnership(_newOwner);
    }
}
```

### Summary

- **Smart Contract**: Create your primary token contract.
- **Presale Mechanism**: Use a dedicated `PresaleToken` contract to manage the presale process.
- **Launchpad Integration**: Create a `LaunchpadTokenManager` contract to handle the launchpad operations once the presale is over.

By following these steps, you can successfully introduce a token into your DeFi project while maintaining a clear separation between the presale and the public sale phases.

