Creating an animated snake game in C with graphics is a great project! Below is a basic outline of how you can structure your code. This example uses simple text for clarity but you can easily integrate image files instead.

### Basic Snake Game Structure

1. **Setup**: Initialize the game window.
2. **Snake Movement**: Control the movement of the snake using arrow keys or WASD.
3. **Collision Detection**: Check if the snake eats food or collides with walls or itself.
4. **Game Over Logic**: Handle the endgame conditions like eating all fruits or losing health points.
5. **Graphics**: Display the snake, fruit, and score using images or ASCII art.

### Example Code Outline (C)

```c
#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#define SCREEN_WIDTH 80
#define SCREEN_HEIGHT 25

// Define colors
typedef enum {
    BLACK = 0,
    WHITE = 1,
    RED = 2,
    GREEN = 3,
    BLUE = 4
} Color;

Color color_map[SCREEN_WIDTH * SCREEN_HEIGHT] = {BLACK};

int screen_width;
int screen_height;

void init_screen(int width, int height) {
    screen_width = width;
    screen_height = height;
}

void draw_snake(int x, int y, int direction) {
    // Draw the snake head
    printf("\x1b[H\x1b[%d;%dt%s ", y + 1, x, " ");

    // Draw the tail based on direction
    switch(direction) {
        case 1: 
            printf(">>>");
            break;
        case -1:
            printf("<<<");
            break;
        case 2:
            printf("vvv");
            break;
        case -2:
            printf("^^^");
            break;
    }

    // Clear line after drawing
    printf("\x1b[2K");
}

void draw_food(int x, int y) {
    // Draw a dot where the food is located
    char c = '#';
    for (int i = 0; i < SCREEN_WIDTH * SCREEN_HEIGHT; ++i) {
        if (color_map[i] == c)
            printf("%s", " ");
        else
            printf("%s", ".");
    }
    printf("\n\n");  // Print newline before moving down
}

void check_collision(int x, int y, int direction) {
    // Simple collision detection
    if (direction == 1 && y <= 1) return;
    if (direction == -1 && y >= screen_height - 2) return;
    if (direction == 2 && x >= screen_width - 2) return;
    if (direction == -2 && x <= 1) return;
}

void update_score(int score) {
    printf("Score: %d\n", score);
}

int main() {
    int score = 0;
    int x = 40, y = 12;
    int direction = 1;

    init_screen(screen_width, screen_height);

    while (true) {
        // Move the snake according to its current direction
        switch (direction) {
            case 1: 
                y--; 
                break;
            case -1: 
                y++; 
                break;
            case 2: 
                x--; 
                break;
            case -2: 
                x++; 
                break;
        }

        // Draw the new position
        draw_snake(x, y, direction);

        // Check for collisions
        check_collision(x, y, direction);

        // Generate new food coordinates
        srand(time(NULL));
        int random_x = rand() % (screen_width / 2);
        int random_y = rand() % (screen_height / 2);
        int random_direction = rand() % 4;

        // Draw the new food
        draw_food(random_x, random_y);

        // Update score
        score++;
        update_score(score);

        // Add delay to control speed
        sleep(0.2);  // Adjust the time to slow down the speed as needed
    }
}
```

### Explanation:

- **Screen Setup**: `init_screen` initializes the display size (`SCREEN_WIDTH` and `SCREEN_HEIGHT`) which determines how many pixels wide and tall the screen will be. This function also sets up the array used to keep track of colors displayed on the screen.

- **Drawing Functions**: `draw_snake` draws the head of the snake. The tail is drawn based on the current direction the snake is facing (up, down, left, right). Each turn involves clearing the previous row with `\x1b[2K` command so no old characters show when we move around.

- **Food Drawing**: `draw_food` simply prints a `#` at the location where the fruit appears, effectively replacing this spot with a `.` once eaten.

