                   (foundPosition + searchWord.length() < currentLine.length() ||
                    !currentLine[currentLine.length() - searchWord.length()] == ' '))
                foundPosition = currentLine.find(searchWord, foundPosition + 1);

            // Move back one character to ensure we don't miss previous instances
            --foundPosition;
        }
    }

    // Close the file after reading
    inputFile.close();

    std::cout << "The word \"" << searchWord << "\" appears " << occurrenceCount << " times in the file.\n";
    return 0;
}
```

### Explanation:
- **Input File**: The program uses `ifstream` to open the file named `"input.txt"`. Replace `"input.txt"` with the actual name of your input file.

- **Word Search**: The user specifies which word they want to count using `searchWord`.

- **Reading Lines**: The program reads lines from the file using a loop (`while (std::getline(inputFile, currentLine))`). Each line is then searched for occurrences of `searchWord`.

- **Finding Word Instances**: The function `find(std::string_view str, std::string_view substr)` is used to find occurrences of the word within each line. The positions where the word is found are recorded.

- **Skipping Over Duplicates**: To avoid counting duplicate occurrences, the loop checks if the next position found is different from the last position found plus one space, ensuring the substring is not starting or ending at the same location as before.

- **Output**: Finally, the program outputs how many times the specified word appears in the entire file.

