2. Compile it using g++ compiler: `g++ -o count_occurrences count_occurrences.cpp`
3. Run the compiled program: `./count_occurrences`

Replace `"specific_word"` with the actual word you wish to search for in your text file. This script will count all instances of that word in the given file.
